import * as THREE from "three";
const modele = new THREE.Group();
import { GLTFLoader } from "three/examples/jsm/loaders/GLTFLoader";
const loader = new GLTFLoader();
import { tag } from "./tag";
import fladme from "./huoyan.js";
loader.load("./scene/model.gltf", (gltf) => {
  modele.add(gltf.scene);

  gltf.scene.traverse((obj) => {
    if (obj.isMesh) {
      obj.material = new THREE.MeshLambertMaterial({
        map: obj.material.map,
        color: obj.material.color,
        side: THREE.DoubleSide,
      });
    }
  });
  const pos3 = new THREE.Vector3();

  const g = gltf.scene.getObjectByName("P_02");
  g.getWorldPosition(pos3);
  fladme.position.copy(pos3)
  fladme.position.y = 33
  modele.add(fladme)
  //   const group = gltf.scene.getObjectByName("粮仓");
  //   group.traverse((obj) => {
  //     if (obj.isMesh) {
  //       const label = tag(obj.name);
  //       const pos = new THREE.Vector3();
  //       obj.getWorldPosition(pos);
  //     //   if (obj.parent.name == "立筒仓") {
  //     //     pos.y += 36; //加上粮仓顶部高度
  //     //   } else if (obj.parent.name == "浅圆仓") {
  //     //     pos.y += 20;
  //     //   } else if (obj.parent.name == "平房仓") {
  //     //     pos.y += 17;
  //     //   }
  //       label.position.copy(pos)
  //       modele.add(label)
  //     }
  //   });
  gltf.scene.children[2].traverse((obj) => {
    if (obj.isMesh) {
      const tag1 = tag(obj.name);
      const pos = new THREE.Vector3();
      obj.getWorldPosition(pos);
      if (obj.parent.name == "立筒仓") {
        pos.y += 36; //加上粮仓顶部高度
      } else if (obj.parent.name == "浅圆仓") {
        pos.y += 20;
      } else if (obj.parent.name == "平房仓") {
        pos.y += 17;
      }
      tag1.position.copy(pos);
      modele.add(tag1);
    }
  });
});

export default modele;
